    e.preventDefault();
    const { Marks, Percentile, Cast } = RegisterInfo;
    if ( !Marks || !Percentile || !Cast) {
        return handleError('All fields are required');
    }
    try {
        const url = 'http://localhost:8080/shreyapp/register';
        const res = await fetch(url, {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json'
            },
            body: JSON.stringify(RegisterInfo)
        }); 
  }catch (error) {
    setError(error.message);
  }
  };


  return (
    <form onSubmit={handleSubmit}>
      <label>Marks:</label>
      <input type="text" value={Marks} onChange={(e) => setMarks(e.target.value)} />
      <br />
      <label>Percentile:</label>
      <input type="text" value={Percentile} onChange={(e) => setPercentile(e.target.value)} />
      <br />
      <label>Cast:</label>
      <input type="text" value={Cast} onChange={(e) => setCast(e.target.value)} />
      <br />
      <button type="submit">Register</button>
      {error && <p style={{ color: 'red' }}>{error}</p>}
    </form>
  );
}

export default RegistrationForm;
